import React from "react";
import { Card } from 'hero-design'

export default function DocumentCard({ cardInfor }: { cardInfor: any }) {
    return (
        <Card
            key={cardInfor.id}
            id={cardInfor.id}
            variant={'basic'}
            style={{ width: '15rem' }}
        >
            <Card.Header>
                {cardInfor.title}
            </Card.Header>
            <Card.Content>
                {
                    cardInfor.description
                }
            </Card.Content>
        </Card>
    )
}
